import { STATE } from "./estado";

export class Contact {
    name = '';
    apellido = '';
    email = '';
    estado = STATE

    constructor (name, apellido, email, estado) {
        this.name = name;
        this.apellido = apellido;
        this.email =  email;
        this.estado = estado;
    }
}
